// eslint-disable-next-line
import React from "react";
import "./Index.css";
import MARUTI_LOGO from "./../../assets/Group 47534.png";

const Cards = () => {
    return(
        <div className=".card-containe">
                <div className="card">
                    <div className=".card-content">
                        <h4>KY Hazard Application</h4>
                        <p>Hazard Recommendation Engine</p>
                        <div>
                            <p>Explore and know more</p>
                            <hr width="30%"></hr>
                        </div>
                        <div className="card_icon"></div>
                    </div>
                </div>
        </div>
    )
}

export default Cards;
